import React from 'react';
import './ContactUs.css';
import FrameLayout from '../../frame_layout/FrameLayout';

function ContactUs() {
   return (
      <FrameLayout>
         <h1>
            Contact Us
         </h1>
         <form target="_blank" action="https://formsubmit.co/tonicarlson13@gmail.com" method="POST">
            <div class="form-input">
               <label for="client-name">Potential client name</label>
               <input id="client-name" type="text" name="name" placeholder="Full name" required />
            </div>
            <div class="form-input">
               <label for="contact-email">Email</label>
               <input id="contact-email" type="email" name="email" placeholder="Email" required/>
            </div>
            <div class="form-input">
               <label for="message-textarea">Your message</label>
               <textarea id="message-textarea" placeholder="Tell us about why you're interested in seeing us." name="message" rows="10" required></textarea>
            </div>
            <button type="submit" class="btn btn-lg btn-dark btn-block">Submit Form</button>
         </form>
      </FrameLayout>
   );
}

export default ContactUs;
